<script>
    let userMarker = null;
    function addUserMarker(lat, lon, label="üè† Casa ingresada") {
        if (typeof map === 'undefined') {
            console.error('Mapa a√∫n no cargado');
            return;
        }
        if (userMarker) {
            map.removeLayer(userMarker);
        }
        userMarker = L.marker([lat, lon], {
            icon: L.icon({
                iconUrl: "https://cdn-icons-png.flaticon.com/512/484/484167.png",
                iconSize: [32, 32],
                iconAnchor: [16, 32]
            })
        }).addTo(map)
        .bindPopup(`<b>${label}</b><br>Lat: ${lat.toFixed(4)}<br>Lon: ${lon.toFixed(4)}`)
        .openPopup();
        map.setView([lat, lon], 15);
    }
    console.log("‚úÖ addUserMarker cargado correctamente");
</script>
